import React from "react";
import "./Weather.css";

export default function Weather() {
  return (
    <div className="Weather">
      <h1>New York</h1>
      <ul>
        <li>Monday 15:00</li>
        <li>Sunny</li>
      </ul>
      <div className="row">
        <div className="col-6"> </div>
      </div>
    </div>
  );
}
